                                        {this.props.extra}

                                </Col>
                            </Row>
                        {/* </PageHeader> */}
                    </Content>
                    <BackBottom/>
                    {/* <Footer>
                    <BlogBottom/>
                    </Footer> */}
                </Layout>            
            </div>
        )
    }

}

export default withRouter(PrivateZone)
